import React from 'react'

const homeheader = () => {
  return (
    <div className="home-header-page">
      <h1>Realizing a more sustainable future.</h1>
      <h3>Wipro is helping companies monitor, track and take action on their environmental impact.</h3>
      <button></button>
    </div>
  )
}

export default homeheader
